import React from 'react'
import "./header.css"

function Header() {
  return (
    <div className='header'>
      <div className="HeaderTitles">
        <span className="headerTitleSm"></span>
        <span className="headerTitleL"></span>
      </div>
    </div>
  )
}

export default Header
